import React from "react";

const ArticleUpload = () => {
    return (
        <div className="w-screen bg-gray-200">
            <div className="w-4/5 mx-auto border my-12">
                <div className="w-full h-16 bg-gray-800">

                </div>
                <form className="w-full h-full flex flex-col">
                    <input className="w-full text-4xl font-semibold p-4 outline-none border-b border-gray-400 my-4" type = "text" name = "title" placeholder = "Title"/>
                    <textarea className = "w-full p-4 outline-none my-4" name = "content" placeholder="Content" rows={10}/>
                    <input type = "text" name = "tag" placeholder="Enter Relevant Tag then press Enter"/>
                </form>
            </div>
        </div>
    );
}

export default ArticleUpload;
